            // USGS Pattern Drawing Functions
            const createUSGSPattern = (ctx, usgsCode, width, height, backgroundColor) => {
                const code = String(usgsCode);
                
                // Try to use preloaded FGDC pattern first
                if (patternImages.current[code]) {
                    // Scale the pattern down to show more tiling and repetition
                    const img = patternImages.current[code];
                    const scaleFactor = 0.25; // Smaller value = more zoomed out = more visible tiling
                    
                    // Create a smaller canvas for the pattern
                    const patternCanvas = document.createElement('canvas');
                    const scaledWidth = img.width * scaleFactor;
                    const scaledHeight = img.height * scaleFactor;
                    patternCanvas.width = scaledWidth;
                    patternCanvas.height = scaledHeight;
                    
                    const pCtx = patternCanvas.getContext('2d');
                    pCtx.fillStyle = backgroundColor;
                    pCtx.fillRect(0, 0, scaledWidth, scaledHeight);
                    pCtx.drawImage(img, 0, 0, scaledWidth, scaledHeight);
                    
                    return ctx.createPattern(patternCanvas, 'repeat');
                }
                
                // Fall back to programmatic pattern generation for missing patterns
                const patternCanvas = document.createElement('canvas');
                const pCtx = patternCanvas.getContext('2d');
                const numCode = parseInt(usgsCode);
                
                // Pattern tile size
                const tileSize = 20;
                patternCanvas.width = tileSize;
                patternCanvas.height = tileSize;
                
                // Fill background
                pCtx.fillStyle = backgroundColor;
                pCtx.fillRect(0, 0, tileSize, tileSize);
                
                // Set pattern color
                pCtx.strokeStyle = '#333';
                pCtx.fillStyle = '#333';
                pCtx.lineWidth = 1;
                
                // Simplified fallback patterns for missing codes
                if (numCode >= 601 && numCode <= 612) {
                    // Sandstone family - dots
                    for (let i = 0; i < 5; i++) {
                        pCtx.beginPath();
                        pCtx.arc(Math.random() * tileSize, Math.random() * tileSize, 0.8, 0, Math.PI * 2);
                        pCtx.fill();
                    }
                } else if (numCode >= 620 && numCode <= 623) {
                    // Shale family - horizontal lines
                    pCtx.lineWidth = 0.5;
                    for (let y = 0; y < tileSize; y += 3) {
                        pCtx.beginPath();
                        pCtx.moveTo(0, y);
                        pCtx.lineTo(tileSize, y);
                        pCtx.stroke();
                    }
                } else if (numCode === 718) {
                    // Granite - plus signs (fallback pattern)
                    for (let i = 0; i < 3; i++) {
                        const x = (i % 2) * tileSize/2 + tileSize/4;
                        const y = Math.floor(i / 2) * tileSize/2 + tileSize/4;
                        pCtx.beginPath();
                        pCtx.moveTo(x - 2, y);
                        pCtx.lineTo(x + 2, y);
                        pCtx.moveTo(x, y - 2);
                        pCtx.lineTo(x, y + 2);
                        pCtx.stroke();
                    }
                }
                
                return ctx.createPattern(patternCanvas, 'repeat');
            };

            const getColor = (age) => {
                if (!age) return '#CCCCCC';
                const ageStr = (age || '').toLowerCase().trim();
                
                // Check built-in color map first
                if (colorMap[ageStr]) return colorMap[ageStr];
                
                // Check if age string contains any geologic period
                for (const [period, color] of Object.entries(colorMap)) {
                    if (ageStr.includes(period)) return color;
                }
                
                // Default gray if no match
                return '#CCCCCC';
            };
            
            const hash = (str) => { let h = 0; for (let i = 0; i < str.length; i++) { h = ((h << 5) - h) + str.charCodeAt(i); h = h & h; } return h; };
            const hslToHex = (h, s, l) => { s /= 100; l /= 100; const c = (1 - Math.abs(2 * l - 1)) * s; const x = c * (1 - Math.abs((h / 60) % 2 - 1)); const m = l - c/2; let r = 0, g = 0, b = 0; if (0 <= h && h < 60) { r = c; g = x; b = 0; } else if (60 <= h && h < 120) { r = x; g = c; b = 0; } else if (120 <= h && h < 180) { r = 0; g = c; b = x; } else if (180 <= h && h < 240) { r = 0; g = x; b = c; } else if (240 <= h && h < 300) { r = x; g = 0; b = c; } else if (300 <= h && h < 360) { r = c; g = 0; b = x; } r = Math.round((r + m) * 255); g = Math.round((g + m) * 255); b = Math.round((b + m) * 255); return '#' + [r, g, b].map(v => v.toString(16).padStart(2, '0')).join(''); };

            const handleStratUpload = async (e) => {

                    const workbook = XLSX.read(arrayBuffer);

                    const data = XLSX.utils.sheet_to_json(firstSheet);
                    const colors = {};
                    data.forEach(row => { const lithKey = Object.keys(row)[0]; const colorKey = Object.keys(row).find(k => /color|hex/i.test(k)); if (lithKey && colorKey && row[lithKey] && row[colorKey]) colors[row[lithKey].toLowerCase()] = row[colorKey]; });
                    // Merge with defaults, custom colors override defaults

            const handlePatternUpload = async (e) => {

                    const workbook = XLSX.read(arrayBuffer);

            const loadExampleData = () => {
                setWellData(EXAMPLE_WELL_DATA);
                setColumns({ 
                    wellId: 'API_Number',

            const getCoordinates = (wellRecords) => {
                if (!wellRecords.length) return { lat: '', lon: '' };
                const record = wellRecords[0];
                let lat = columns.latitude ? record[columns.latitude] : '';
                let lon = columns.longitude ? record[columns.longitude] : '';
                if (lat && lon) {
                    if (typeof lat === 'string') lat = parseFloat(lat.replace(/[^\d.-]/g, ''));
                    if (typeof lon === 'string') lon = parseFloat(lon.replace(/[^\d.-]/g, ''));
                    if (isNaN(lat) || isNaN(lon)) return { lat: '', lon: '' };
                    return { lat: lat.toFixed(6), lon: lon.toFixed(6) };
                }
                return { lat: '', lon: '' };
            };

            const generateStratImage = (wellRecords) => {
                if (!wellRecords.length) return null;
                const canvas = canvasRef.current;
                if (!canvas) return null;
                const ctx = canvas.getContext('2d');
                const width = 1280, margin = 60, columnWidth = 160;
                const legendX = margin + columnWidth + 30; // Legend starts after column
                
                const sorted = [...wellRecords].sort((a, b) => parseFloat(a[columns.topDepth]) - parseFloat(b[columns.topDepth]));
                const minDepth = Math.min(...sorted.map(r => parseFloat(r[columns.topDepth])));
                const maxDepth = Math.max(...sorted.map(r => parseFloat(r[columns.bottomDepth])));
                const depthRange = maxDepth - minDepth || 1;
                
                // Calculate minimum thickness to determine scale
                const thicknesses = sorted.map(r => parseFloat(r[columns.bottomDepth]) - parseFloat(r[columns.topDepth]));
                const minThickness = Math.min(...thicknesses);
                
                // Ensure thinnest unit is at least 25 pixels tall (for text readability)
                const minPixelHeight = 25;
                let pixelsPerFoot = minPixelHeight / minThickness;
                
                // Calculate total chart height based on scale, with minimum of 300 pixels
                let chartHeight = depthRange * pixelsPerFoot;
                const minChartHeight = 300;
                if (chartHeight < minChartHeight) {
                    chartHeight = minChartHeight;
                    // Recalculate scale to fill the minimum height
                    pixelsPerFoot = chartHeight / depthRange;
                }
                
                const titleSpace = 50; // Space for title and surface elevation
                const height = chartHeight + 2 * margin + titleSpace;
                
                canvas.width = width; 
                canvas.height = height;
                ctx.fillStyle = 'white'; 
                ctx.fillRect(0, 0, width, height);
                
                // Draw title
                ctx.fillStyle = '#000'; ctx.font = 'bold 16px Arial, sans-serif'; ctx.textAlign = 'center';
                ctx.fillText(`Well ${wellRecords[0][columns.wellId]}`, width / 2, 25);
                
                // Draw depth range under well ID
                ctx.font = '12px Arial, sans-serif';
                ctx.fillText(`Depth Range: ${minDepth.toFixed(1)} - ${maxDepth.toFixed(1)} ft`, width / 2, 42);
                
                // Draw depth axis
                const chartTop = margin + titleSpace;
                ctx.strokeStyle = '#333'; ctx.lineWidth = 2; ctx.beginPath();
                ctx.moveTo(margin, chartTop); ctx.lineTo(margin, chartTop + chartHeight); ctx.stroke();
                
                // Depth labels
                ctx.font = '12px Arial, sans-serif'; ctx.textAlign = 'right';
                const numLabels = 5;
                for (let i = 0; i <= numLabels; i++) {
                    const depth = minDepth + (depthRange * i / numLabels);
                    const y = chartTop + (chartHeight * i / numLabels);
                    ctx.fillText(depth.toFixed(0) + ' ft', margin - 10, y + 4);
                    ctx.beginPath(); ctx.moveTo(margin - 5, y); ctx.lineTo(margin, y); ctx.stroke();
                }
                
                // Draw surface elevation on top of column (if available)
                if (columns.surfaceElevation && wellRecords[0][columns.surfaceElevation]) {
                    const elevation = wellRecords[0][columns.surfaceElevation];
                    ctx.save();
                    ctx.fillStyle = '#000';
                    ctx.font = 'bold 11px Arial';
                    ctx.textAlign = 'center';
                    const columnCenterX = margin + 10 + columnWidth / 2;
                    ctx.fillText(`Surface Elev: ${parseFloat(elevation).toFixed(1)} ft`, columnCenterX, chartTop - 8);
                    ctx.restore();
                }
                
                // Draw legend table headers
                const legendStartY = chartTop;
                ctx.strokeStyle = '#666';
                ctx.lineWidth = 1;
                ctx.font = 'bold 11px Arial';
                ctx.fillStyle = '#000';
                ctx.textAlign = 'left';
                
                const colWidths = { unit: 220, age: 240, lith: 240, thick: 60 };
                let headerX = legendX;
                
                // Column headers
                ctx.fillText('Stratigraphic Unit', headerX + 2, legendStartY + 12);
                headerX += colWidths.unit;
                ctx.fillText('Age', headerX + 2, legendStartY + 12);
                headerX += colWidths.age;
                ctx.fillText('Lithology', headerX + 2, legendStartY + 12);
                headerX += colWidths.lith;
                ctx.fillText('Thickness (ft)', headerX + 2, legendStartY + 12);
                
                // Header underline
                ctx.beginPath();
                ctx.moveTo(legendX, legendStartY + 16);
                ctx.lineTo(legendX + colWidths.unit + colWidths.age + colWidths.lith + colWidths.thick, legendStartY + 16);
                ctx.stroke();
                
                // Draw strat column and legend entries
                let legendY = legendStartY + 26;
                ctx.font = '11px Arial, sans-serif';
                
                sorted.forEach(record => {
                    const top = parseFloat(record[columns.topDepth]);
                    const bottom = parseFloat(record[columns.bottomDepth]);
                    const unitName = record[columns.unitName] || '';
                    const age = columns.age ? record[columns.age] : '';
                    const lithology = columns.lithology ? record[columns.lithology] : '';
                    const thickness = bottom - top;
                    
                    const y1 = chartTop + ((top - minDepth) * pixelsPerFoot);
                    const y2 = chartTop + ((bottom - minDepth) * pixelsPerFoot);
                    const rectHeight = y2 - y1;
                    
                    if (rectHeight > 0) {
                        const x = margin + 10;
                        const color = getColor(age);
                        
                        // Draw colored background on column
                        ctx.fillStyle = color;
                        ctx.fillRect(x, y1, columnWidth, rectHeight);
                        
                        // Get USGS code for pattern
                        // Uses bidirectional matching: checks if lithology contains pattern key OR pattern key contains first word of lithology
                        // This allows matching both "sandstone" to "sand" and "sand" to "sandstone"
                        let usgsCode = null;
                        if (usePatterns && lithology) {
                            const lithStr = lithology.toLowerCase().trim();
                            for (const [key, value] of Object.entries(patternMap)) {
                                if (lithStr.includes(key) || key.includes(lithStr.split(' ')[0])) {
                                    usgsCode = value;
                                    break;
                                }
                            }
                        }
                        
                        // Draw pattern on column if available
                        if (usgsCode) {
                            const pattern = createUSGSPattern(ctx, usgsCode, columnWidth, rectHeight, color);
                            if (pattern) {
                                ctx.fillStyle = pattern;
                                ctx.fillRect(x, y1, columnWidth, rectHeight);
                            }
                        }
                        
                        // Draw border on column
                        ctx.strokeStyle = '#333'; ctx.lineWidth = 1;
                        ctx.strokeRect(x, y1, columnWidth, rectHeight);
                        
                        // Draw unit label on column if space allows
                        if (rectHeight > 20) {
                            ctx.save();
                            const text = unitName.substring(0, 20);
                            ctx.font = '11px Arial, sans-serif';
                            ctx.textAlign = 'left';
                            
                            // Draw white outline for text visibility
                            ctx.strokeStyle = 'white';
                            ctx.lineWidth = 3;
                            ctx.strokeText(text, x + 5, y1 + 14);
                            
                            // Draw black text on top
                            ctx.fillStyle = '#000';
                            ctx.fillText(text, x + 5, y1 + 14);
                            ctx.restore();
                        }
                        
                        // Draw thickness in center of unit if space allows
                        if (rectHeight > 35) {
                            ctx.save();
                            const thicknessText = `${thickness.toFixed(1)} ft`;
                            ctx.font = 'bold 10px Arial, sans-serif';
                            ctx.textAlign = 'center';
                            
                            // Calculate center position
                            const centerY = y1 + rectHeight / 2 + 4;
                            const centerX = x + columnWidth / 2;
                            
                            // Draw white outline for text visibility
                            ctx.strokeStyle = 'white';
                            ctx.lineWidth = 3;
                            ctx.strokeText(thicknessText, centerX, centerY);
                            
                            // Draw black text on top
                            ctx.fillStyle = '#000';
                            ctx.fillText(thicknessText, centerX, centerY);
                            ctx.restore();
                        }
                        
                        // Draw legend entry (if space available)
                        if (legendY < height - margin - 10) {
                            ctx.font = '11px Arial, sans-serif';
                            ctx.fillStyle = '#000';
                            ctx.textAlign = 'left';
                            
                            let entryX = legendX;
                            const legendBoxSize = 24; // Consistent box size for both age and lithology
                            
                            // Unit name (truncated if needed)
                            const truncatedUnit = unitName.length > 70 ? unitName.substring(0, 68) + '...' : unitName;
                            ctx.fillText(truncatedUnit, entryX + 2, legendY + 16);
                            entryX += colWidths.unit;
                            
                            // Age color box
                            ctx.fillStyle = color;
                            ctx.fillRect(entryX + 2, legendY + 2, legendBoxSize, legendBoxSize);
                            ctx.strokeStyle = '#333';
                            ctx.lineWidth = 0.5;
                            ctx.strokeRect(entryX + 2, legendY + 2, legendBoxSize, legendBoxSize);
                            
                            // Age text (properly aligned with box)
                            ctx.fillStyle = '#000';
                            const truncatedAge = (age || 'N/A').length > 40 ? (age || 'N/A').substring(0, 40) + '...' : (age || 'N/A');
                            ctx.fillText(truncatedAge, entryX + 2 + legendBoxSize + 6, legendY + 16);
                            entryX += colWidths.age;
                            
                            // Lithology pattern box (with age color background for consistency)
                            if (usgsCode) {
                                // Use age color background for pattern (consistent with column display)
                                ctx.fillStyle = color;
                                ctx.fillRect(entryX + 2, legendY + 2, legendBoxSize, legendBoxSize);
                                const miniPattern = createUSGSPattern(ctx, usgsCode, legendBoxSize, legendBoxSize, color);
                                if (miniPattern) {
                                    ctx.fillStyle = miniPattern;
                                    ctx.fillRect(entryX + 2, legendY + 2, legendBoxSize, legendBoxSize);
                                }
                            } else {
                                ctx.fillStyle = '#f0f0f0';
                                ctx.fillRect(entryX + 2, legendY + 2, legendBoxSize, legendBoxSize);
                            }
                            ctx.strokeStyle = '#333';
                            ctx.lineWidth = 0.5;
                            ctx.strokeRect(entryX + 2, legendY + 2, legendBoxSize, legendBoxSize);
                            
                            // Lithology text (properly aligned with box)
                            ctx.fillStyle = '#000';
                            const truncatedLith = (lithology || 'N/A').length > 40 ? (lithology || 'N/A').substring(0, 40) + '...' : (lithology || 'N/A');
                            ctx.fillText(truncatedLith, entryX + 2 + legendBoxSize + 6, legendY + 16);
                            entryX += colWidths.lith;
                            
                            // Thickness
                            ctx.fillText(thickness.toFixed(1), entryX + 2, legendY + 16);
                            
                            legendY += 30; // Increased spacing for larger font size
                        }
                    }
                });
                
                // Draw AZGS logo and citation in lower right corner
                const logoSize = 50;
                const logoX = width - logoSize - 15;
                const logoY = height - logoSize - 30;
                
                if (logoImage && logoImage.complete && logoImage.naturalWidth > 0) {
                    ctx.drawImage(logoImage, logoX, logoY, logoSize, logoSize);
                }
                
                // Draw citation text below logo if provided (with word wrapping)
                if (citation && citation.trim()) {
                    ctx.save();
                    ctx.font = '10px Arial, sans-serif';
                    ctx.fillStyle = '#666';
                    
                    // Word wrapping function
                    const wrapText = (text, maxWidth) => {
                        const words = text.split(' ');
                        const lines = [];
                        let currentLine = '';
                        
                        for (let word of words) {
                            const testLine = currentLine ? currentLine + ' ' + word : word;
                            const metrics = ctx.measureText(testLine);
                            
                            if (metrics.width > maxWidth && currentLine) {
                                lines.push(currentLine);
                                currentLine = word;
                            } else {
                                currentLine = testLine;
                            }
                        }
                        if (currentLine) {
                            lines.push(currentLine);
                        }
                        return lines;
                    };
                    
                    // Calculate maximum width for citation (from left edge to right margin)
                    const rightMargin = 15;
                    const leftMargin = 70; // Start citation from left side for long text
                    const maxCitationWidth = width - leftMargin - rightMargin;
                    
                    // Wrap the citation text
                    const citationLines = wrapText(citation.trim(), maxCitationWidth);
                    
                    // Draw each line from bottom up (so last line is at height - 15)
                    const lineHeight = 12;
                    const startY = height - 15;
                    
                    ctx.textAlign = 'left';
                    citationLines.forEach((line, index) => {
                        const y = startY - ((citationLines.length - 1 - index) * lineHeight);
                        ctx.fillText(line, leftMargin, y);
                    });
                    
                    ctx.restore();
                }
                
                // Draw border around entire image with small gap from edge
                const borderGap = 2; // pixels from edge
                ctx.strokeStyle = '#000';
                ctx.lineWidth = 3;
                ctx.strokeRect(borderGap, borderGap, width - (borderGap * 2), height - (borderGap * 2));
                
                return canvas.toDataURL('image/jpeg', 0.95); // JPEG format for compatibility
            };

            const createImageWithGPS = async (dataUrl, lat, lon) => {
                // Skip EXIF GPS embedding for JPEGs as it can corrupt files for ArcGIS Pro
                // Instead, rely on the CSV file with coordinates for XY Table to Point workflow
                const latNum = parseFloat(lat);
                const lonNum = parseFloat(lon);
                
                if (!lat || !lon || isNaN(latNum) || isNaN(lonNum)) {
                    console.log('No valid GPS coordinates available for CSV');
                } else {
                    console.log(`Coordinates for CSV: ${latNum.toFixed(6)}, ${lonNum.toFixed(6)}`);
                }
                
                // Return clean JPEG without EXIF modification
                return dataUrl;
            };

            const handleGeneratePreview = async () => {
                if (!previewWell) return;
                
                try {
                    const records = wellData.filter(r => r[columns.wellId] === previewWell);
                    
                    if (records.length === 0) {
                        alert(`No data found for well ${previewWell}`);
                        return;
                    }
                    
                    const imageData = generateStratImage(records);
                    
                    if (!imageData) {
                        alert(`Failed to generate image for well ${previewWell}. Check console for details.`);
                        return;
                    }
                    
                    const coords = getCoordinates(records);
                    const withGPS = await createImageWithGPS(imageData, coords.lat, coords.lon);
                    setPreviewImage(withGPS);
                } catch (error) {
                    console.error('Preview generation error:', error);
                    alert(`Error generating preview: ${error.message}`);
                }
            };

            const handleDownload = () => {
                if (!previewImage) return;
                const link = document.createElement('a');
                link.download = `well_${previewWell}_strat.jpg`; // Changed to .jpg for ArcGIS Pro
                link.href = previewImage;
                link.click();
            };

            const handleDownloadPackage = async () => {
                if (!wellData || generating) return;
                setGenerating(true);
                try {
                    const zip = new JSZip();
                    const uniqueWells = [...new Set(wellData.map(r => r[columns.wellId]))];
                    setProgress({ current: 0, total: uniqueWells.length });
                    
                    // Generate CSV
                    const csvData = [['API', 'Latitude', 'Longitude', 'ImagePath']];
                    const imageFiles = [];
                    
                    for (let i = 0; i < uniqueWells.length; i++) {
                        const wellId = uniqueWells[i];
                        const records = wellData.filter(r => r[columns.wellId] === wellId);
                        const coords = getCoordinates(records);
                        if (coords.lat && coords.lon) {
                            const imagePath = `${wellId}.jpg`;
                            csvData.push([wellId, coords.lat, coords.lon, imagePath]);
                            const imageData = generateStratImage(records);
                            if (imageData) {
                                const withGPS = await createImageWithGPS(imageData, coords.lat, coords.lon);
                                const base64Data = withGPS.split(',')[1];
                                zip.file(`${wellId}.jpg`, base64Data, { base64: true }); // Changed to .jpg for ArcGIS Pro
                            }
                        }
                        setProgress({ current: i + 1, total: uniqueWells.length });
                        await new Promise(resolve => setTimeout(resolve, 10));
                    }
                    
                    // Add CSV to ZIP
                    const csvContent = csvData.map(row => row.join(',')).join('\n');
                    zip.file('wells.csv', csvContent);
                    
                    // Generate and download ZIP
                    const content = await zip.generateAsync({ type: 'blob' });
                    const url = URL.createObjectURL(content);
                    const link = document.createElement('a');
                    link.href = url;
                    link.download = `${packageName}.zip`;
                    link.click();
                    URL.revokeObjectURL(url);
                    
                    alert(`Package created!\n\n${uniqueWells.length} wells processed\nDownloaded as: ${packageName}.zip`);
                } catch (err) {
                    alert('Error generating package: ' + err.message);
                } finally {
                    setGenerating(false);
                    setProgress({ current: 0, total: 0 });
                }
            };

            const uniqueWells = wellData ? [...new Set(wellData.map(r => r[columns.wellId]))].filter(w => w) : [];
            const hasCoords = wellData && wellData.length > 0 && columns.latitude && columns.longitude && wellData.some(r => r[columns.latitude] && r[columns.longitude]);

            return (
                <div style={{ padding: '40px', maxWidth: '1200px', margin: '0 auto' }}>
                    <canvas ref={canvasRef} style={{ display: 'none' }} />
                    <div style={{ textAlign: 'center', marginBottom: '40px' }}>
                        <h1 style={{ fontSize: '36px', marginBottom: '10px', color: '#AB0520', fontWeight: 'bold' }}>Well Stratigraphy Image Generator</h1>
                        <p style={{ fontSize: '18px', color: '#0C234B' }}>with Authentic USGS FGDC Patterns & Geologic Age Colors</p>
                    </div>
                    <div style={{ marginBottom: '30px' }}>
                        <div style={{ background: 'white', padding: '25px', borderRadius: '12px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)', maxWidth: '600px', margin: '0 auto' }}>
                            <h3 style={{ marginBottom: '15px', display: 'flex', alignItems: 'center', gap: '10px' }}>
                                <Upload size={24} style={{ color: '#0C234B' }} />
                                Well Stratigraphy Data
                            </h3>
                            <input type="file" accept=".xlsx,.xls" onChange={handleStratUpload} style={{ width: '100%' }} />
                            <p style={{ fontSize: '12px', color: '#666', marginTop: '10px' }}>
                                {wellData ? `${wellData.length} records loaded` : 'Upload Excel file'}
                            </p>
                            <div style={{ marginTop: '15px', paddingTop: '15px', borderTop: '1px solid #e2e8f0' }}>
                                <button onClick={loadExampleData} style={{ width: '100%', padding: '12px 20px', background: '#0C234B', color: 'white', border: 'none', borderRadius: '6px', cursor: 'pointer', fontSize: '14px', fontWeight: '500', display: 'flex', alignItems: 'center', justifyContent: 'center', gap: '8px' }}>
                                    Load Example Wells (844 Arizona Wells)
                                </button>
                                <p style={{ fontSize: '11px', color: '#666', marginTop: '8px', textAlign: 'center' }}>
                                    Load all 5,005 cleaned well records
                                </p>
                            </div>
                        </div>
                    </div>
                    {wellData && (<>
                        <div style={{ background: '#FFFFFF', padding: '20px', borderRadius: '8px', marginBottom: '30px', border: '1px solid #e2e8f0' }}>
                            <details open={showColumnMapping} onToggle={(e) => setShowColumnMapping(e.target.open)} style={{ fontSize: '14px' }}>
                                <summary style={{ cursor: 'pointer', fontWeight: 'bold', fontSize: '18px', marginBottom: '15px', color: '#0C234B', listStyle: 'none' }}>
                                    <span style={{ display: 'inline-block', marginRight: '8px' }}>{showColumnMapping ? 'v' : '>'}</span>
                                    Column Mapping
                                </summary>
                                <div style={{ marginTop: '15px' }}>
                                    <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '15px' }}>
                                        {Object.entries(columns).map(([key, value]) => (
                                            <div key={key}>
                                                <label style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px', fontSize: '14px' }}>
                                                    {key.replace(/([A-Z])/g, ' $1').replace(/^./, s => s.toUpperCase())}
                                                    {['latitude', 'longitude'].includes(key) && ' '}
                                                </label>
                                                <select value={value} onChange={(e) => setColumns({...columns, [key]: e.target.value})} style={{ width: '100%', padding: '8px', borderRadius: '4px', border: '1px solid #cbd5e0', fontSize: '14px' }}>
                                                    <option value="">-- Select --</option>
                                                    {Object.keys(wellData[0]).map(col => <option key={col} value={col}>{col}</option>)}
                                                </select>
                                            </div>
                                        ))}
                                    </div>
                                    <div style={{ marginTop: '15px', padding: '12px', background: '#e0f2fe', borderRadius: '6px', fontSize: '13px', lineHeight: '1.6' }}>
                                        <strong>Tip:</strong> Age  determines color fill (e.g., Cretaceous, Jurassic). Lithology (rock type) determines pattern (e.g., Sandstone, Shale).
                                    </div>
                                    {(() => { 
                                        const testRec = wellData[0];
                                        const testLat = columns.latitude ? testRec[columns.latitude] : '';
                                        const testLon = columns.longitude ? testRec[columns.longitude] : '';
                                        const testElev = columns.surfaceElevation ? testRec[columns.surfaceElevation] : '';
                                        return (
                                            <>
                                                <div style={{ marginTop: '15px', padding: '10px', background: testLat && testLon ? '#E2E9EB' : '#FFF8DC', borderRadius: '4px', fontSize: '14px' }}>
                                                    <strong>Coordinates: </strong>{testLat && testLon ? `OK - Found (${testLat}, ${testLon})` : ' Not found - package will not work'}
                                                </div>
                                                {testElev && (
                                                    <div style={{ marginTop: '10px', padding: '10px', background: '#E2E9EB', borderRadius: '4px', fontSize: '14px' }}>
                                                        <strong>Surface Elevation: </strong>OK - Found ({parseFloat(testElev).toFixed(1)} ft)
                                                    </div>
                                                )}
                                            </>
                                        );
                                    })()}
                                </div>
                            </details>
                        </div>
                        <div style={{ background: '#FFFFFF', padding: '20px', borderRadius: '8px', marginBottom: '30px', border: '1px solid #e2e8f0' }}>
                            <h3 style={{ marginBottom: '15px' }}>Generate Files for ArcGIS Pro</h3>
                            <div style={{ marginBottom: '15px', maxWidth: '600px' }}>
                                <label style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px', fontSize: '14px' }}>Package Name</label>
                                <input type="text" value={packageName} onChange={(e) => setPackageName(e.target.value)} placeholder="wells_with_images" style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #cbd5e0', fontSize: '14px' }} />
                                <p style={{ fontSize: '12px', color: '#666', marginTop: '5px' }}>Name for the downloaded ZIP file</p>
                            </div>
                            <div style={{ marginBottom: '15px', maxWidth: '600px' }}>
                                <label style={{ display: 'block', fontWeight: 'bold', marginBottom: '5px', fontSize: '14px' }}>Citation (optional)</label>
                                <input type="text" value={citation} onChange={(e) => setCitation(e.target.value)} placeholder="e.g., Data from USGS, 2024" style={{ width: '100%', padding: '10px', borderRadius: '4px', border: '1px solid #cbd5e0', fontSize: '14px' }} />
                                <p style={{ fontSize: '12px', color: '#666', marginTop: '5px' }}>AZGS logo and citation appear in lower right corner</p>
                            </div>
                            {generating && (<div style={{ marginBottom: '15px', background: '#81D3EB', padding: '12px', borderRadius: '4px', maxWidth: '800px' }}>
                                <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '8px', fontSize: '14px', fontWeight: '500' }}>
                                    <span>Processing wells...</span><span>{progress.current} / {progress.total}</span>
                                </div>
                                <div style={{ width: '100%', height: '10px', background: '#e5e7eb', borderRadius: '5px', overflow: 'hidden' }}>
                                    <div style={{ width: `${(progress.current / progress.total) * 100}%`, height: '100%', background: '#0C234B', transition: 'width 0.3s' }} />
                                </div>
                            </div>)}
                            <div style={{ maxWidth: '800px' }}>
                                <button onClick={handleDownloadPackage} disabled={generating || !hasCoords} style={{ width: '100%', padding: '20px', background: (generating || !hasCoords) ? '#CBD5E0' : '#AB0520', color: 'white', border: 'none', borderRadius: '8px', cursor: (generating || !hasCoords) ? 'not-allowed' : 'pointer', fontWeight: 'bold', fontSize: '16px' }}>
                                    <Camera size={24} style={{ display: 'inline', marginRight: '10px', verticalAlign: 'middle' }} />
                                    {generating ? 'Generating...' : `Download ZIP Package (${uniqueWells.length} wells)`}
                                </button>
                            </div>
                            <div style={{ marginTop: '15px', padding: '15px', background: '#E2E9EB', borderRadius: '6px', fontSize: '13px', lineHeight: '1.7', maxWidth: '800px' }}>
                                <strong style={{ fontSize: '14px' }}> ZIP Package Contents:</strong>
                                <ul style={{ margin: '8px 0 0 0', paddingLeft: '20px' }}>
                                    <li>wells.csv - API, Latitude, Longitude, and ImagePath for each well</li>
                                    <li>{uniqueWells.length} JPEG images - Stratigraphic columns with patterns</li>
                                </ul>
                            </div>
                            <div style={{ marginTop: '10px', maxWidth: '800px' }}>
                                <button onClick={() => setShowArcGISHelp(!showArcGISHelp)} style={{ padding: '10px 15px', background: '#E2E9EB', color: '#0C234B', border: '1px solid #0C234B', borderRadius: '6px', cursor: 'pointer', fontSize: '13px', fontWeight: '500', width: '100%', textAlign: 'left' }}>
                                    {showArcGISHelp ? 'v' : '>'} <strong>ArcGIS Pro:</strong> How to import these images
                                </button>
                                {showArcGISHelp && (
                                    <div style={{ marginTop: '10px', padding: '15px', background: '#fff', borderRadius: '6px', border: '1px solid #CBD5E0', fontSize: '13px', lineHeight: '1.7' }}>
                                        <strong style={{ display: 'block', marginBottom: '10px', color: '#0C234B' }}> Import Workflow: XY Table to Point + Attachments</strong>
                                        <ol style={{ margin: '8px 0 0 0', paddingLeft: '20px' }}>
                                            <li><strong>Extract ZIP:</strong> Extract all files from the downloaded ZIP to a folder</li>
                                            <li style={{ marginTop: '8px' }}><strong>Import Points from CSV:</strong> In Catalog, right-click wells.csv  XY Table To Point
                                                <ul style={{ marginTop: '5px', paddingLeft: '20px' }}>
                                                    <li>X Field: Longitude</li>
                                                    <li>Y Field: Latitude</li>
                                                    <li>Coordinate System: WGS 1984</li>
                                                    <li>Output: Save to your geodatabase (e.g., wells_points)</li>
                                                </ul>
                                            </li>
                                            <li style={{ marginTop: '8px' }}><strong>Enable Attachments:</strong> Right-click feature class  Manage  Enable Attachments</li>
                                            <li style={{ marginTop: '8px' }}><strong>Add Image Attachments:</strong> Data Management Tools  Attachments  Add Attachments
                                                <ul style={{ marginTop: '5px', paddingLeft: '20px' }}>
                                                    <li>Input Dataset: wells_points (your feature class)</li>
                                                    <li>Input Join Field: API</li>
                                                    <li>Match Table: wells.csv</li>
                                                    <li>Match Join Field: API</li>
                                                    <li>Match Path Field: ImagePath</li>
                                                    <li>Working Folder: Browse to folder with extracted JPEG files</li>
                                                </ul>
                                            </li>
                                        </ol>
                                        <div style={{ marginTop: '10px', padding: '10px', background: '#FFF8DC', borderRadius: '4px', fontSize: '12px' }}>
                                            <strong>Tip:</strong> The CSV includes an ImagePath column that makes the Add Attachments workflow seamless. All images will be automatically linked to their well points.
                                        </div>
                                    </div>
                                )}
                            </div>
                            <div style={{ marginTop: '10px', maxWidth: '800px' }}>
                                <button onClick={() => setShowWindowsHelp(!showWindowsHelp)} style={{ padding: '10px 15px', background: '#f3f4f6', color: '#374151', border: '1px solid #CBD5E0', borderRadius: '6px', cursor: 'pointer', fontSize: '13px', fontWeight: '500', width: '100%', textAlign: 'left' }}>
                                    {showWindowsHelp ? 'v' : '>'} <strong>Windows Users:</strong> Can't extract the ZIP file?
                                </button>
                                {showWindowsHelp && (
                                    <div style={{ marginTop: '10px', padding: '15px', background: '#fff', borderRadius: '6px', border: '1px solid #CBD5E0', fontSize: '13px', lineHeight: '1.7' }}>
                                        <strong style={{ display: 'block', marginBottom: '10px', color: '#AB0520' }}> If Windows is blocking the ZIP file:</strong>
                                        <ol style={{ margin: '8px 0 0 0', paddingLeft: '20px' }}>
                                            <li><strong>Right-click</strong> the downloaded ZIP file</li>
                                            <li>Select <strong>Properties</strong></li>
                                            <li>At the bottom, find <strong>Security</strong> section</li>
                                            <li>Check the <strong>"Unblock"</strong> checkbox</li>
                                            <li>Click <strong>Apply</strong> then <strong>OK</strong></li>
                                            <li>Now you should be able to extract the ZIP file</li>
                                        </ol>
                                    </div>
                                )}
                            </div>
                        </div>
                        <div style={{ background: '#FFFFFF', padding: '20px', borderRadius: '8px', border: '1px solid #e2e8f0' }}>
                            <h3 style={{ marginBottom: '15px' }}>Preview</h3>
                            <div style={{ display: 'flex', gap: '10px', marginBottom: '15px', flexWrap: 'wrap' }}>
                                <select value={previewWell} onChange={(e) => setPreviewWell(e.target.value)} style={{ flex: 1, minWidth: '200px', padding: '10px', borderRadius: '4px', border: '1px solid #cbd5e0', fontSize: '14px' }}>
                                    <option value="">Select well...</option>
                                    {uniqueWells.map(well => <option key={well} value={well}>{well}</option>)}
                                </select>
                                <button onClick={handleGeneratePreview} disabled={!previewWell} style={{ padding: '10px 20px', background: previewWell ? '#0C234B' : '#CBD5E0', color: 'white', border: 'none', borderRadius: '4px', cursor: previewWell ? 'pointer' : 'not-allowed', fontWeight: '500' }}>Generate</button>
                            </div>
                            {previewImage && (<div style={{ background: 'white', padding: '20px', borderRadius: '8px', border: '1px solid #cbd5e0' }}>
                                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '15px' }}>
                                    <h4 style={{ margin: 0 }}>Well {previewWell}</h4>
                                    <button onClick={handleDownload} style={{ padding: '8px 16px', background: '#AB0520', color: 'white', border: 'none', borderRadius: '4px', cursor: 'pointer', fontWeight: '500' }}>
                                        <Download size={16} style={{ display: 'inline', marginRight: '5px', verticalAlign: 'middle' }} />Download
                                    </button>
                                </div>
                                <div style={{ textAlign: 'center' }}><img src={previewImage} alt="Stratigraphic Column" style={{ maxWidth: '100%', border: '1px solid #e5e7eb', borderRadius: '4px' }} /></div>
                            </div>)}
                        </div>
                        <div style={{ background: 'white', padding: '25px', borderRadius: '12px', boxShadow: '0 4px 6px rgba(0,0,0,0.1)', marginTop: '30px' }}>
                            <details style={{ fontSize: '14px' }}>
                                <summary style={{ cursor: 'pointer', fontWeight: 'bold', fontSize: '18px', marginBottom: '15px', color: '#0C234B' }}>
                                     Advanced Settings
                                </summary>
                                <div style={{ marginTop: '20px', paddingTop: '15px', borderTop: '1px solid #e2e8f0' }}>
                                    <h4 style={{ fontSize: '14px', fontWeight: 'bold', marginBottom: '10px' }}>Geologic Age Colors</h4>
                                    <div style={{ padding: '10px', background: '#E2E9EB', borderRadius: '6px', fontSize: '12px', marginBottom: '10px' }}>
                                        <strong>OK - Authentic USGS FGDC:</strong> {Object.keys(DEFAULT_COLOR_MAP).length} geologic age colors
                                    </div>
                                    <details style={{ fontSize: '12px', color: '#666', marginBottom: '20px' }}>
                                        <summary style={{ cursor: 'pointer', fontWeight: '500' }}>Override with custom colors</summary>
                                        <input type="file" accept=".xlsx,.xls" onChange={handleColorUpload} style={{ width: '100%', marginTop: '8px', fontSize: '12px' }} />
                                        <p style={{ fontSize: '11px', color: '#666', marginTop: '5px' }}>
                                            Upload custom color file
                                        </p>
                                    </details>
                                    
                                    <h4 style={{ fontSize: '14px', fontWeight: 'bold', marginBottom: '10px', marginTop: '15px' }}>USGS Pattern Settings</h4>
                                    <div style={{ marginBottom: '10px' }}>
                                        <label style={{ display: 'flex', alignItems: 'center', gap: '8px', cursor: 'pointer', fontSize: '13px' }}>
                                            <input type="checkbox" checked={usePatterns} onChange={(e) => setUsePatterns(e.target.checked)} />
                                            <span style={{ fontWeight: '500' }}>Enable pattern fills</span>
                                        </label>
                                    </div>
                                    <div style={{ padding: '10px', background: '#E2E9EB', borderRadius: '6px', fontSize: '12px', marginBottom: '10px' }}>
                                        <strong>OK - Authentic USGS FGDC:</strong> {Object.keys(DEFAULT_PATTERN_MAP).length} USGS patterns
                                    </div>
                                    <details style={{ fontSize: '12px', color: '#666' }}>
                                        <summary style={{ cursor: 'pointer', fontWeight: '500' }}>Override with custom patterns</summary>
                                        <input type="file" accept=".xlsx,.xls" onChange={handlePatternUpload} style={{ width: '100%', marginTop: '8px', fontSize: '12px' }} />
                                        <p style={{ fontSize: '11px', color: '#666', marginTop: '5px' }}>
                                            Upload custom pattern file
                                        </p>
                                    </details>
                                </div>
                            </details>
                        </div>
                    </>)}
                </div>
            );
        };

        ReactDOM.render(<StratImageGenerator />, document.getElementById('root'));
    </script>
</body>
</html>
